import React from "react";
import { Grid, Typography } from "@material-ui/core";

export default function test() {
  return (
    <>
      <Grid container>
        <Grid item xs={12}>
          <Typography variant="h4">some text</Typography>
        </Grid>
        <Grid item xs={12}>
          <Typography variant="h4"> some more text</Typography>
        </Grid>
      </Grid>
    </>
  );
}
